DROP TABLE notifications;

CREATE TABLE notifications (
    notification_id SERIAL PRIMARY KEY,
    alias  VARCHAR(128),
    short_name VARCHAR(128),
    text VARCHAR(4096),
    remove_active_users bool NOT NULL
);

CREATE TABLE notification_fires (
    fire_id SERIAL PRIMARY KEY,
    notification_id INT,
    fire_at TIMESTAMP NOT NULL,
    last_fire_time TIMESTAMP NOT NULL,
    CONSTRAINT notification_key
    FOREIGN KEY(notification_id)
    REFERENCES notifications(notification_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);

CREATE TABLE notification_users (
    user_id INT,
    fire_id INT,
    CONSTRAINT user_id_key FOREIGN KEY (user_id) REFERENCES users(user_id) ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE INDEX notification_users_user_idx ON notification_users(user_id);
CREATE INDEX notification_users_fire_idx ON notification_users(fire_id);


